import style from "./OptionRadioMain.module.css";

import InputRadio from "../../../../UI/InputRadio/InputRadio";

function OptionRadio(props) {
  function changeRadioHandler(e) {
    props.setOptionMainData(e.target.value);
  }

  return (
    <div className={style["first__option"]}>
      <InputRadio
        classContainer={style["radio__container"]}
        classInput={style.input}
        classLabel={`${style.labelBlue} ${style.label}`}
        classCheck={style.checkBlue}
        classInside={style.insideBlue}
        onChange={changeRadioHandler}
        id="time"
        name="chart"
        value="time"
        label="time"
      />
      <InputRadio
        classContainer={style["radio__container"]}
        classInput={style.input}
        classLabel={style.labelGreen}
        classCheck={style.checkGreen}
        classInside={style.insideGreen}
        onChange={changeRadioHandler}
        id="category"
        name="chart"
        value="category"
        label="category"
      />
    </div>
  );
}

export default OptionRadio;
